import React, { useState } from "react";
import { Link } from "react-router-dom";
import PersonIcon from "@mui/icons-material/Person";
import Badge from "@mui/material/Badge";
import { useAuth } from "../../context/auth";
import toast from "react-hot-toast";
import { useCart } from "../../context/cart";
import Cart from "../../pages/CartPage";

const Header = () => {
  const [auth, setAuth] = useAuth();
  const [cart] = useCart();
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);

  const handleLogout = () => {
    setAuth({
      ...auth,
      user: null,
      token: "",
    });
    localStorage.removeItem("auth");
    toast.success("Logout Successfully");
  };

  const toggleDrawer = () => {
    setIsDrawerOpen(!isDrawerOpen);
  };

  return (
    <nav className="bg-white sticky top-0 w-full z-20 px-5 py-1">
      <div className="max-w-screen-xl flex items-center justify-between mx-auto p-4">
        <div className="flex items-center">
          <img src="your-logo-url" className="h-12 mr-3" alt="Logo" />
          <span className="self-center text-2xl font-bold whitespace-nowrap dark:text-white">
            CARTCRAFT
          </span>
        </div>

        {/* Display Drawer button on small screens */}
        <div className="md:hidden">
          <button className="text-white" onClick={toggleDrawer}>
            <Cart />
          </button>
        </div>

        {/* Display links in a horizontal row on larger screens */}
        <div className="hidden md:flex items-center space-x-4">
          <Link to="/" className="text-white">
            Home
          </Link>
          <Link to="/contact" className="text-white">
            Contact
          </Link>
          {!auth.user ? (
            <>
              <Link to="/login" className="text-white">
                Login
              </Link>
              <Link to="/register" className="text-white">
                Register
              </Link>
            </>
          ) : (
            <>
              <Link
                to={`/dashboard/${auth.user.role === 1 ? "admin" : "user"}`}
                className="text-white"
              >
                Dashboard
              </Link>
              <button className="text-white" onClick={handleLogout}>
                Logout
              </button>
            </>
          )}
          <Link to="/cart" className="text-white">
            <Badge badgeContent={cart.length} color="error">
              <Cart />
            </Badge>
          </Link>
        </div>
      </div>

      {/* Display Drawer content on small screens */}
      {isDrawerOpen && (
        <div className="md:hidden">
          <div className="bg-white p-4">
            <p>Drawer Content</p>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/contact">Contact</Link>
              </li>
              {/* Add more drawer links as needed */}
            </ul>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Header;
